Explicación: Este soneto pertenece a Juana de Ibarbourou, poeta uruguaya naciente en 1892 y fallecida en 1979, por lo que vivió en el siglo XX. El poema refleja su estilo característico de usar la naturaleza como metáfora para explorar temas existenciales como la vida, la muerte y la fugacidad del tiempo.
